// مسیر: src/components/Navbar/Navbar.js
import React from "react";
import "./Navbar.css";
import { FaShoppingCart, FaUser, FaBell, FaSearch } from "react-icons/fa";
import logo from "../../assets/digikala-logo.png"; // جایگزین با تصویر نهایی

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <img src={logo} alt="دیجی‌کالا" className="logo" />
        <div className="search-box">
          <input type="text" placeholder="جستجو" />
          <FaSearch className="search-icon" />
        </div>
      </div>
      <div className="navbar-right">
        <FaShoppingCart className="icon" />
        <FaUser className="icon" />
        <FaBell className="icon" />
      </div>
    </nav>
  );
};

export default Navbar;
